::: {.cell}

```{.r .cell-code}
max_text_contrast <- function(bgs){
  w_contrast <- abs(
    contrast_ratio(
      "white", bgs,
      algorithm = "APCA"
    )[,1]
  )
  b_contrast <- abs(
    contrast_ratio(
      "black", bgs,
      algorithm = "APCA"
    )[,1]
  )
  out_cols <- c("white", "black")

  out_cols[
    cbind(w_contrast, b_contrast) |>
      apply(1, which.max)
  ]

}
```
