    hoverinfo = "none"
  ) |> 
  add_trace(
    x = sin(seq(0, pi*2, length = 100)) * 0.5,
    y = cos(seq(0, pi*2, length = 100)) * 0.5,
    z = rep(0, 100),
    mode = "lines",
    line = list(color = "grey"),
    hoverinfo = "none"
  ) |> 
  add_trace(
    x = sin(seq(0, pi*2, length = 100)) * 0.5,
    z = cos(seq(0, pi*2, length = 100)) * 0.5,
