make_mod_plot <- function(comp_hls, mod, mode  = "light") {

  segments <- make_mod_segments(comp_hls, mod)

  p <- base_sphere()

  for(i in seq_along(segments$data)){
    d <- segments$data[[i]]
    col <- segments$base[i]
    markers <- c(rep("circle", length(d$x)-1), "diamond")
    sizes <- c(10, rep(1, length(d$x)-2), 5)
    p |>
      add_trace(
        type = "scatter3d",
        mode = "markers+lines",
        x = ~x,
        y = ~y,
        z = ~z,
        name = col,
        data = d,
        mode = "lines",
        line = list(
          color = d$hex,
          width = 5
        )
        ,marker = list(
          size = sizes,
          symbol =  markers,
          color = d$hex
        )
      ) ->
      p
  }
  p |> 
    layout(title = list(text = mod))->
    p
  if (mode == "dark") {
    p |> 
      layout(
        paper_bgcolor = "#222",
        scene = list(
          xaxis = list(
            domain = c(-1, 1),
            color = "#222"
          ),
          yaxis = list(
            domain = c(-1, 1),
            color = "#222"
          ),
          zaxis = list(
            domain = c(-1, 1),
            color = "#222"
          )      
        ),
        title = list(text = mod, font = list(color = "white"))
      ) ->
      p
  }
  p
}
